import { useEffect, useState } from "react";

type stardata={
    name: string, 
    height: number, 
     mass: 77, 
    hair_color: string, 
    skin_color: string, 
    eye_color: string, 
    birth_year: string, 
    gender: string, 
    homeworld: string
}

const StarApi=({name,height,mass,hair_color,skin_color,eye_color,birth_year,gender,homeworld}:stardata)=>{

const[peopledata,setPeopleData]=useState<stardata|any>([])
    useEffect(() => {
        async function fetchMyAPI() {
           await fetch('api/data')
           .then((res)=>res.json())
           .then(res=>setPeopleData(res.results))

        }

        fetchMyAPI()
      }, [])
    return(<>

<ul>
{
    peopledata.map((data:any)=>{return<p>{data.name}</p>})
}

</ul>
    </>)
}

export default StarApi;
